  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `code` int DEFAULT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `expense_requisitions`;
CREATE TABLE `expense_requisitions` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `requisition_date` date NOT NULL,
  `currency` enum('NGN','USD') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'NGN',
  `title` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `price` decimal(10,2) NOT NULL,
  `amount_paid` decimal(10,2) NOT NULL,
  `expense_account` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `discount_percentage` decimal(5,2) NOT NULL,
  `tax` decimal(10,2) NOT NULL,
  `customer` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `department` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `branch` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `project` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `expense_requisitions_new`;
CREATE TABLE `expense_requisitions_new` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `reason` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `date` date DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `image_path` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `amount` decimal(10,2) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `sub_cat_id` bigint unsigned NOT NULL,
  `account_id` bigint unsigned NOT NULL,
  `created_by` bigint unsigned NOT NULL,
  `approval_status` enum('pending','approved','disapproved') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'pending',
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  `branch_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `expense_requisitions_new_sub_cat_id_foreign` (`sub_cat_id`),
  KEY `expense_requisitions_new_account_id_foreign` (`account_id`),
  KEY `expense_requisitions_new_created_by_foreign` (`created_by`),
  CONSTRAINT `expense_requisitions_new_account_id_foreign` FOREIGN KEY (`account_id`) REFERENCES `accounts` (`id`) ON DELETE CASCADE,
  CONSTRAINT `expense_requisitions_new_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`),
  CONSTRAINT `expense_requisitions_new_sub_cat_id_foreign` FOREIGN KEY (`sub_cat_id`) REFERENCES `expense_sub_categories` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `expense_sub_categories`;
CREATE TABLE `expense_sub_categories` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `code` int DEFAULT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `exp_id` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`),
  KEY `expense_sub_categories_exp_id_foreign` (`exp_id`),
  CONSTRAINT `expense_sub_categories_exp_id_foreign` FOREIGN KEY (`exp_id`) REFERENCES `expense_categories` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `expenses`;
CREATE TABLE `expenses` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `reason` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `date` date DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `image_path` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `sub_cat_id` bigint unsigned NOT NULL,
  `transaction_id` bigint unsigned NOT NULL,
  `created_by` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  `branch_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `expenses_sub_cat_id_foreign` (`sub_cat_id`),
  KEY `expenses_transaction_id_foreign` (`transaction_id`),
  KEY `expenses_created_by_foreign` (`created_by`),
  CONSTRAINT `expenses_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`),
  CONSTRAINT `expenses_sub_cat_id_foreign` FOREIGN KEY (`sub_cat_id`) REFERENCES `expense_sub_categories` (`id`) ON DELETE CASCADE,
  CONSTRAINT `expenses_transaction_id_foreign` FOREIGN KEY (`transaction_id`) REFERENCES `account_transactions` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `failed_jobs`;
CREATE TABLE `failed_jobs` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `uuid` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `connection` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `queue` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `payload` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `exception` longtext COLLATE utf8mb4_unicode_ci NOT NULL,
  `failed_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`),
  UNIQUE KEY `failed_jobs_uuid_unique` (`uuid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `general_settings`;
CREATE TABLE `general_settings` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `key` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `display_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `value` text COLLATE utf8mb4_unicode_ci,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`),
  UNIQUE KEY `general_settings_key_unique` (`key`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `inventory_adjustments`;
CREATE TABLE `inventory_adjustments` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `reason` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `code` int DEFAULT NULL,
  `date` date DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_by` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`),
  KEY `inventory_adjustments_created_by_foreign` (`created_by`),
  CONSTRAINT `inventory_adjustments_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `invoice_payments`;
CREATE TABLE `invoice_payments` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `amount` double(12,2) DEFAULT NULL,
  `discount` double(12,2) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `invoice_id` bigint unsigned NOT NULL,
  `transaction_id` bigint unsigned DEFAULT NULL,
  `created_by` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`),
  KEY `invoice_payments_invoice_id_foreign` (`invoice_id`),
  KEY `invoice_payments_transaction_id_foreign` (`transaction_id`),
  KEY `invoice_payments_created_by_foreign` (`created_by`),
  CONSTRAINT `invoice_payments_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`),
  CONSTRAINT `invoice_payments_invoice_id_foreign` FOREIGN KEY (`invoice_id`) REFERENCES `invoices` (`id`) ON DELETE CASCADE,
  CONSTRAINT `invoice_payments_transaction_id_foreign` FOREIGN KEY (`transaction_id`) REFERENCES `account_transactions` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `invoice_products`;
CREATE TABLE `invoice_products` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `quantity` double(12,2) DEFAULT NULL,
  `purchase_price` double(12,2) DEFAULT NULL,
  `sale_price` double(12,2) DEFAULT NULL,
  `unit_cost` double(12,2) DEFAULT NULL,
  `tax_amount` double(12,2) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `invoice_id` bigint unsigned NOT NULL,
  `product_id` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `payment_status` enum('paid','unpaid') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  `item_discount` double DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `invoice_products_invoice_id_foreign` (`invoice_id`),
  KEY `invoice_products_product_id_foreign` (`product_id`),
  CONSTRAINT `invoice_products_invoice_id_foreign` FOREIGN KEY (`invoice_id`) REFERENCES `invoices` (`id`) ON DELETE CASCADE,
  CONSTRAINT `invoice_products_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `invoice_return_products`;
CREATE TABLE `invoice_return_products` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `sale_price` double(12,2) DEFAULT NULL,
  `purchase_price` double(12,2) DEFAULT NULL,
  `quantity` double(12,2) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `return_id` bigint unsigned NOT NULL,
  `product_id` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`),
  KEY `invoice_return_products_return_id_foreign` (`return_id`),
  KEY `invoice_return_products_product_id_foreign` (`product_id`),
  CONSTRAINT `invoice_return_products_product_id_foreign` FOREIGN KEY (`product_id`) REFERENCES `products` (`id`) ON DELETE CASCADE,
  CONSTRAINT `invoice_return_products_return_id_foreign` FOREIGN KEY (`return_id`) REFERENCES `invoice_returns` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `invoice_returns`;
CREATE TABLE `invoice_returns` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `return_no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `reason` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `total_return` double(12,2) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `invoice_id` bigint unsigned NOT NULL,
  `transaction_id` bigint unsigned DEFAULT NULL,
  `created_by` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`),
  KEY `invoice_returns_invoice_id_foreign` (`invoice_id`),
  KEY `invoice_returns_transaction_id_foreign` (`transaction_id`),
  KEY `invoice_returns_created_by_foreign` (`created_by`),
  CONSTRAINT `invoice_returns_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`),
  CONSTRAINT `invoice_returns_invoice_id_foreign` FOREIGN KEY (`invoice_id`) REFERENCES `invoices` (`id`) ON DELETE CASCADE,
  CONSTRAINT `invoice_returns_transaction_id_foreign` FOREIGN KEY (`transaction_id`) REFERENCES `account_transactions` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `invoices`;
CREATE TABLE `invoices` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `invoice_no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `reference` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `transport` double(12,2) DEFAULT NULL,
  `discount` double(12,2) DEFAULT NULL,
  `discount_type` tinyint unsigned NOT NULL COMMENT '0 means fixed, 1 means percentage, 2 means item-based percentage',
  `sub_total` double(12,2) DEFAULT NULL,
  `po_reference` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `payment_terms` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `delivery_place` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `invoice_date` date DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `is_paid` tinyint(1) DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `client_id` bigint unsigned NOT NULL,
  `tax_id` bigint unsigned DEFAULT NULL,
  `created_by` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `chart_of_account_id` bigint unsigned DEFAULT NULL,
  `payment_account_id` bigint unsigned DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  `branch_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `invoices_client_id_foreign` (`client_id`),
  KEY `invoices_tax_id_foreign` (`tax_id`),
  KEY `invoices_created_by_foreign` (`created_by`),
  KEY `invoices_chart_of_account_id_foreign` (`chart_of_account_id`),
  KEY `invoices_payment_account_id_foreign` (`payment_account_id`),
  CONSTRAINT `invoices_chart_of_account_id_foreign` FOREIGN KEY (`chart_of_account_id`) REFERENCES `chart_of_accounts` (`id`),
  CONSTRAINT `invoices_client_id_foreign` FOREIGN KEY (`client_id`) REFERENCES `clients` (`id`) ON DELETE CASCADE,
  CONSTRAINT `invoices_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`),
  CONSTRAINT `invoices_payment_account_id_foreign` FOREIGN KEY (`payment_account_id`) REFERENCES `chart_of_accounts` (`id`),
  CONSTRAINT `invoices_tax_id_foreign` FOREIGN KEY (`tax_id`) REFERENCES `vat_rates` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `journal_entries`;
CREATE TABLE `journal_entries` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `reference` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `amount` double NOT NULL,
  `type` enum('debit','credit') COLLATE utf8mb4_unicode_ci NOT NULL,
  `chart_of_account_id` bigint unsigned DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `account_id` bigint unsigned DEFAULT NULL,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `journal_entries_chart_of_account_id_foreign` (`chart_of_account_id`),
  KEY `journal_entries_account_id_foreign` (`account_id`),
  CONSTRAINT `journal_entries_account_id_foreign` FOREIGN KEY (`account_id`) REFERENCES `accounts` (`id`),
  CONSTRAINT `journal_entries_chart_of_account_id_foreign` FOREIGN KEY (`chart_of_account_id`) REFERENCES `chart_of_accounts` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `loan_authorities`;
CREATE TABLE `loan_authorities` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `contact_number` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `cc_limit` decimal(14,2) DEFAULT NULL,
  `address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `loan_payments`;
CREATE TABLE `loan_payments` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `reference_no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `amount` double(12,2) DEFAULT NULL,
  `interest` double(12,2) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `image_path` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `loan_id` bigint unsigned NOT NULL,
  `transaction_id` bigint unsigned NOT NULL,
  `created_by` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`),
  KEY `loan_payments_loan_id_foreign` (`loan_id`),
  KEY `loan_payments_transaction_id_foreign` (`transaction_id`),
  KEY `loan_payments_created_by_foreign` (`created_by`),
  CONSTRAINT `loan_payments_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`),
  CONSTRAINT `loan_payments_loan_id_foreign` FOREIGN KEY (`loan_id`) REFERENCES `loans` (`id`) ON DELETE CASCADE,
  CONSTRAINT `loan_payments_transaction_id_foreign` FOREIGN KEY (`transaction_id`) REFERENCES `account_transactions` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


DROP TABLE IF EXISTS `loans`;
CREATE TABLE `loans` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `reason` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `reference_no` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `loan_type` tinyint(1) DEFAULT NULL,
  `interest` double(12,2) DEFAULT NULL,
  `payable` double(12,2) DEFAULT NULL,
  `payment_type` tinyint(1) DEFAULT NULL COMMENT '0 is Daily 1 is Monthly and 2 is Yearly',
  `duration` tinyint unsigned DEFAULT NULL,
  `date` date DEFAULT NULL,
  `note` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  `is_paid` tinyint(1) DEFAULT '0',
  `image_path` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `authority_id` bigint unsigned NOT NULL,
  `transaction_id` bigint unsigned NOT NULL,
  `created_by` bigint unsigned NOT NULL,
  `tags` json DEFAULT NULL,
  `where_created` enum('online','local') COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `sync_status` enum('not-synced','processing','synced') COLLATE utf8mb4_unicode_ci NOT NULL DEFAULT 'not-synced',
  PRIMARY KEY (`id`),
  KEY `loans_authority_id_foreign` (`authority_id`),
  KEY `loans_transaction_id_foreign` (`transaction_id`),
  KEY `loans_created_by_foreign` (`created_by`),
  CONSTRAINT `loans_authority_id_foreign` FOREIGN KEY (`authority_id`) REFERENCES `loan_authorities` (`id`) ON DELETE CASCADE,
  CONSTRAINT `loans_created_by_foreign` FOREIGN KEY (`created_by`) REFERENCES `users` (`id`),
